ControlPropertyState.AutoRuleBindingString:
//Select(Parent)
If(
    ThisItem.Title = "All tickets",
    Navigate(
        TicketPage,
        ScreenTransition.Fade,
        {type: "All"}
    ),
    If(
        ThisItem.Title = "New tickets",
        Navigate(
            TicketPage,
            ScreenTransition.Fade,
            {type: "New"}
        ),
        If(
            ThisItem.Title = "Tickets in progress",
            Navigate(
                TicketPage,
                ScreenTransition.Fade,
                {type: "In progress"}
            ),
            If(
                ThisItem.Title = "Tickets approval",
                Navigate(
                    ApprovalPage,
                    ScreenTransition.Fade,
                    {type: "Approval"}
                ),
                If(
                    ThisItem.Title = "Tickets closed",
                    Navigate(
                        TicketPage,
                        ScreenTransition.Fade,
                        {type: "Closed"}
                    ),
                    If(
                        ThisItem.Title = "Tickets rejected",
                        Navigate(
                            TicketPage,
                            ScreenTransition.Fade,
                            {type: "Rejected"}
                        )
                    )
                )
            )
        )
    )
);
